import React, {Component} from 'react';

const TITLE = [
    'a software engineer',
    'a music lover',
    'an enthusiastic learner',
    'an adventure seaker'
]

class Title extends Component {
    state = {titleIndex: 0};

    render(){
        const title = TITLE[this.state.titleIndex];

        return (
            <p>I am {title}</p>
        )
    }
}

export default Title;
